import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError("Please enter a URL.");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError("Backend not reachable.");
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <h1 style={styles.title}>AI Phishing URL Detector</h1>

        <input
          type="text"
          placeholder="Enter a URL to analyze..."
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          Analyze URL
        </button>

        {loading && <p style={styles.loading}>Analyzing...</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.resultBox}>
            <h2 style={styles.resultTitle}>Result</h2>

            <p style={styles.resultText}>
              <span style={{ fontWeight: "bold" }}>Final Prediction: </span>
              <span
                style={{
                  color:
                    result.final_prediction === "Phishing" ? "#E53935" : "#43A047",
                  fontWeight: "600",
                }}
              >
                {result.final_prediction}
              </span>
            </p>

            <p style={styles.resultText}>
              <b>ML Prediction:</b> {result.ml_prediction}{" "}
              <span style={{ color: "#777" }}>
                {result.ml_prediction === 1 ? "(Phishing)" : "(Legitimate)"}
              </span>
            </p>

            <p style={styles.resultText}>
              <b>ML Probability:</b>{" "}
              {(result.ml_probability * 100).toFixed(2)}%
            </p>
          </div>
        )}
      </div>
    </div>
  );
}

// -------------------- AESTHETIC UI STYLES --------------------

const styles = {
  page: {
    background: "linear-gradient(135deg, #dfe9f3, #ffffff)",
    minHeight: "100vh",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    padding: "20px",
    fontFamily: "'Poppins', sans-serif",
  },
  card: {
    width: "100%",
    maxWidth: "550px",
    padding: "30px",
    borderRadius: "18px",
    background: "rgba(255, 255, 255, 0.7)",
    backdropFilter: "blur(12px)",
    boxShadow: "0 10px 35px rgba(0,0,0,0.15)",
    textAlign: "center",
  },
  title: {
    fontSize: "28px",
    fontWeight: "600",
    marginBottom: "25px",
    color: "#333",
  },
  input: {
    width: "100%",
    padding: "14px",
    borderRadius: "12px",
    border: "1.5px solid #ccc",
    fontSize: "16px",
    marginBottom: "18px",
    outline: "none",
    transition: "0.3s",
  },
  button: {
    width: "100%",
    padding: "14px",
    borderRadius: "12px",
    background: "linear-gradient(135deg, #5A60FF, #7A66FF)",
    color: "white",
    fontSize: "18px",
    fontWeight: "600",
    border: "none",
    cursor: "pointer",
    transition: "0.3s",
  },
  loading: {
    marginTop: "20px",
    color: "#555",
  },
  error: {
    marginTop: "20px",
    color: "#E53935",
  },
  resultBox: {
    marginTop: "30px",
    padding: "20px",
    borderRadius: "12px",
    background: "rgba(255,255,255,0.9)",
    boxShadow: "0 6px 20px rgba(0,0,0,0.10)",
  },
  resultTitle: {
    fontSize: "22px",
    marginBottom: "15px",
    fontWeight: "600",
    color: "#444",
  },
  resultText: {
    fontSize: "17px",
    marginBottom: "10px",
  },
};

export default App;
